/// ```
/// use regex::bytes::Regex;
///
/// let re = Regex::new(r"([0-9]{4})-([0-9]{2})-([0-9]{2})").unwrap();
/// let hay = b"1973-01-05, 1975-08-25 and 1980-10-18";
///
/// let mut dates: Vec<(&[u8], &[u8], &[u8])> = vec![];
/// for (_, [y, m, d]) in re.captures_iter(hay).map(|c| c.extract()) {
///     dates.push((y, m, d));
/// }
/// assert_eq!(dates, vec![
///     (&b"1973"[..], &b"01"[..], &b"05"[..]),
///     (&b"1975"[..], &b"08"[..], &b"25"[..]),
///     (&b"1980"[..], &b"10"[..], &b"18"[..]),
/// ]);
/// ```
